A continuación, te proporciono un ejemplo de código para ESP32 que lee la dirección y la temperatura de sensores Dallas 18B20 y los muestra por el monitor serial. Para este ejemplo, se asume que estás usando una biblioteca OneWire para comunicación con los sensores. Si no la tienes, puedes encontrarla en el repositorio de OneWire de Maxim Integrated: https://github.com/milesburton/Arduino-OneWire

```cpp
#include <OneWire.h>
#include <DallasTemperature.h>

#define ONE_WIRE_BUS 4

OneWire oneWire(ONE_WIRE_BUS);
DallasTemperature sensors(&oneWire);

DeviceAddress sensor1 = { 0x28, 0x00, 0x00, 0x00, 0x00, 0x00, 0x00, 0x00 };
DeviceAddress sensor2 = { 0x28, 0x00, 0x00, 0x00, 0x00, 0x00, 0x00, 0x01 };

void setup() {
  Serial.begin(115200);
  sensors.begin();
}

void loop() {
  sensors.requestTemperatures();

  float sensor1_temperature = sensors.getTempC(sensor1);
  float sensor2_temperature = sensors.getTempC(sensor2);

  Serial.print("Sensor 1: ");
  Serial.print(sensor1_temperature);
  Serial.print(" °C\t");

  Serial.print("Sensor 2: ");
  Serial.print(sensor2_temperature);
  Serial.print(" °C\t");

  Serial.println();

  delay(1000);
}
```

En este código, reemplaza las direcciones de los sensores (sensor1 y sensor2) con las direcciones de los sensores que estés usando. La dirección debe ser un arreglo de 8 bytes, donde cada byte es un número hexadecimal.

Para usar este código, conéctale los sensores a los pines correspondientes en el ESP32 y cargue el código al ESP32 a través de Arduino IDE. Luego, abra el monitor serial en Arduino IDE y verá la temperatura de los sensores cada segundo.

A continuación, se presenta una implementación del algoritmo Bubble Sort en C:

```c
#include <stdio.h>

void bubbleSort(int arr[], int n) {
    int i, j, temp;
    for (i = 0; i < n-1; i++) {
        for (j = 0; j < n-i-1; j++) {
            if (arr[j] > arr[j+1]) {
                // Swap arr[j] and arr[j+1]
                temp = arr[j];
                arr[j] = arr[j+1];
                arr[j+1] = temp;
            }
        }
    }
}

void printArray(int arr[], int size) {
    int i;
    for (i=0; i < size; i++)
        printf("%d ", arr[i]);
    printf("\n");
}

int main() {
    int arr[] = {64, 34, 25, 12, 22, 11, 90};
    int n = sizeof(arr)/sizeof(arr[0]);
    bubbleSort(arr, n);
    printf("Sorted array: \n");
    printArray(arr, n);
    return 0;
}
```

Este código define una función `bubbleSort` que ordena un arreglo de enteros en orden ascendente. La función `printArray` imprime el arreglo ordenado. En el main, se define un arreglo de enteros y se llama a las funciones `bubbleSort` y `printArray`.

