Here is a JavaScript function that takes an array of 5 numbers as input and checks if any of the numbers are prime. If a prime number is found, it will be printed to the console.

```javascript
function checkPrime(arr) {
    if (arr.length !== 5) {
        console.error("Array should contain exactly 5 numbers.");
        return;
    }

    for (let i = 0; i < arr.length; i++) {
        let num = arr[i];
        if (num < 2) continue; // numbers less than 2 are not prime

        for (let j = 2; j <= Math.sqrt(num); j++) {
            if (num % j === 0) {
                // not prime
                break;
            }
        }

        // if the loop finished without finding a factor, the number is prime
        if (j > Math.sqrt(num)) {
            console.log(num);
        }
    }
}

// Example usage:
let numbers = [17, 2, 3, 13, 19];
checkPrime(numbers);
```

This function first checks if the array has exactly 5 numbers. Then it iterates through the array, checks if the number is less than 2 (since 2 is the smallest prime number), and if it is, it skips to the next number.

For each number, it checks if there is a factor between 2 and the square root of the number. If it finds a factor, it breaks the loop and moves on to the next number. If it doesn't find a factor, the number is prime, and it logs the number to the console.

En Java, puedes crear un bucle `for` de la siguiente manera:

```java
for (inicialización; condición; incremento) {
    // Código a ejecutar en cada iteración
}
```

- `inicialización`: Se ejecuta una sola vez al inicio del bucle, para inicializar la variable de control.
- `condición`: Se evalúa antes de cada iteración. Si es verdadera, se ejecuta el código del cuerpo del bucle. Si es falsa, el bucle termina.
- `incremento`: Se ejecuta al final de cada iteración. Puede ser utilizado para modificar la variable de control.

Aquí hay un ejemplo sencillo de un bucle `for` en Java que imprime los números del 1 al 10:

```java
public class Main {
    public static void main(String[] args) {
        for (int i = 1; i <= 10; i++) {
            System.out.println(i);
        }
    }
}
```

En este ejemplo, `i` es la variable de control, se inicializa en 1, la condición es que `i` sea menor o igual a 10, y el incremento es que `i` se incremente en 1 después de cada iteración.
